use super::*;

#[test]
fn test_2024_04_part_1_small() {
    let result = part1(INPUT_SMALL.split("\n").collect());
    assert_eq!(result, 18);
}

#[test]
fn test_2024_04_part_1_big() {
    let result = part1((INPUT).split("\n").collect());
    assert_eq!(result, 2562);
}

#[test]
fn test_2024_04_part_2_small() {
    let result = part2(INPUT_SMALL.split("\n").collect());
    assert_eq!(result, 9);
}

#[test]
fn test_2024_04_part_2_big() {
    let result = part2(INPUT.split("\n").collect());
    assert_eq!(result, 1902);
}

